import React, {Component} from 'react';
import './Navbar.css';
import logo from '../Assets/Logo.svg';

class Navbar extends Component {
    render() {
        return (
            <div className='navbar'>
                <div className='nav-logo'>
                    <img src={logo} alt=''/>
                </div>
                <ul className='nav-menu'></ul>
            </div>
        );
    }
}

export default Navbar;
